<?php

namespace AppBundle\Command;

use AppBundle\Document\Payment\Payment;
use AppBundle\Document\Policy;
use AppBundle\Document\ScheduledPayment;
use AppBundle\Service\BacsService;
use AppBundle\Service\PolicyService;
use Doctrine\ODM\MongoDB\DocumentManager;
use Symfony\Bundle\FrameworkBundle\Command\ContainerAwareCommand;
use Symfony\Component\Console\Input\InputInterface;
use Symfony\Component\Console\Input\InputOption;
use Symfony\Component\Console\Output\OutputInterface;

class BacsRegenerateSchedulesCommand extends ContainerAwareCommand
{
    /**
     * @var DocumentManager
     */
    private $dm;

    /**
     * @var BacsService
     */
    private $bacsService;

    /**
     * @var PolicyService
     */
    private $policyService;

    public function __construct(
        DocumentManager $dm,
        BacsService $bacsService,
        PolicyService $policyService
    ) {
        parent::__construct();
        $this->dm = $dm;
        $this->bacsService = $bacsService;
        $this->policyService = $policyService;
    }

    protected function configure()
    {
        $this->setName('sosure:bacs:regenerate:schedules')
            ->setDescription("Regenerate Scheduled Payments for BACs policies.")
            ->addOption(
                'status',
                's',
                InputOption::VALUE_REQUIRED,
                "ALL, CURRENT, ACTIVE, UNPAID"
            )
            ->addOption(
                'dry-run',
                'd',
                InputOption::VALUE_NONE,
                "See output without saving"
            )
            ->addOption(
                'policy-id',
                'p',
                InputOption::VALUE_REQUIRED,
                'If you have a specific policy to regenerate, give the long ID'
            )
            ->addOption(
                'fix',
                'f',
                InputOption::VALUE_NONE,
                "A more selective run of the policy data"
            );
    }

    protected function execute(InputInterface $input, OutputInterface $output)
    {
        $status = $input->getOption('status');
        $dryRun = $input->getOption('dry-run');
        $policyId = $input->getOption('policy-id');
        $fix = $input->getOption('fix');
        if ($fix) {
            return $this->runFixAndRegen($output, $status, $dryRun, $policyId);
        }

        $qb = $this->dm->createQueryBuilder(Policy::class)
            ->field('paymentMethod.type')->equals('bacs');
        if ($status) {
            switch ($status) {
                case 'CURRENT':
                    $qb->field('status')->in([Policy::STATUS_ACTIVE, Policy::STATUS_UNPAID]);
                    break;
                case 'ACTIVE':
                    $qb->field('status')->equals(Policy::STATUS_ACTIVE);
                    break;
                case 'UNPAID':
                    $qb->field('status')->equals(Policy::STATUS_UNPAID);
                    break;
                default:
                    break;
            }
        }
        if ($policyId) {
            $qb->field('_id')->equals(new \MongoId($policyId));
        }
        $policies = $qb->getQuery()->execute();
        $dateToUse = new \DateTime();
        /** @var Policy $policy */
        foreach ($policies as $policy) {
            $billing = $policy->getBilling();
            if ($billing) {
                $yearMonth = $dateToUse->format('m-Y');
                $day = $billing->format('d-');
                $dateToUse = new \DateTime($day . $yearMonth);
            }
            if ($dryRun) {
                $output->writeln(sprintf(
                    "Policy %s would be regenerated and status is %s",
                    $policy->getId(),
                    $policy->getStatus()
                ));
            } else {
                $output->writeln(sprintf(
                    "Regenerating Scheduled Payments for policy %s",
                    $policy->getId()
                ));
                $this->policyService->regenerateScheduledPayments($policy, $dateToUse);
            }
        }
    }

    private function runFixAndRegen(OutputInterface $output, $status = "CURRENT", $dryRun = false, $policyId = null)
    {
        $qb = $this->dm->createQueryBuilder(Policy::class)
            ->field('paymentMethod.type')->equals('bacs');
        if ($status) {
            switch ($status) {
                case 'CURRENT':
                    $qb->field('status')->in([Policy::STATUS_ACTIVE, Policy::STATUS_UNPAID]);
                    break;
                case 'ACTIVE':
                    $qb->field('status')->equals(Policy::STATUS_ACTIVE);
                    break;
                case 'UNPAID':
                    $qb->field('status')->equals(Policy::STATUS_UNPAID);
                    break;
                default:
                    break;
            }
        }
        if ($policyId) {
            $qb->field('_id')->equals(new \MongoId($policyId));
        }
        $policies = $qb->getQuery()->execute();
        $dateToUse = new \DateTime();
        /** @var Policy $policy */
        foreach ($policies as $policy) {
            if ($this->isDone($policy->getId())) {
                $this->removeDoublePaymentIfPresent($policy, $output, $dryRun);
            } else {
                $billing = $policy->getBilling();
                if ($billing) {
                    $dateToUse = $billing;
                }
                if ($dryRun) {
                    $output->writeln(sprintf(
                        "Policy %s would be regenerated and status is %s",
                        $policy->getId(),
                        $policy->getStatus()
                    ));
                } else {
                    $output->writeln(sprintf(
                        "Regenerating Scheduled Payments for policy %s",
                        $policy->getId()
                    ));
                    $this->policyService->regenerateScheduledPayments($policy, $dateToUse);
                }
            }
        }
    }

    public function removeDoublePaymentIfPresent(Policy $policy, OutputInterface $output, $dryRun)
    {
        $scheduledPayments = $policy->getAllScheduledPayments('scheduled');
        $payments = $policy->getSuccessfulPayments();
        $count = 0;
        $toDelete = null;
        /** @var ScheduledPayment $scheduledPayment */
        foreach ($scheduledPayments as $scheduledPayment) {
            if (!$scheduledPayment->getScheduled()) {
                $output->writeln(
                    sprintf(
                        "Scheduled payment %s for policy %s has not date scheduled",
                        $scheduledPayment->getScheduled(),
                        $policy->getId()
                    )
                );
                continue;
            }
            $monthAndYear = $scheduledPayment->getScheduled()->format('mY');
            if ($monthAndYear === '072019') {
                $count++;
            }
            $fullFormat = $scheduledPayment->getScheduled()->format('dmY');
            if ($fullFormat === '30072019') {
                $toDelete = $scheduledPayment;
            }
        }
        /** @var Payment $payment */
        foreach ($payments as $payment) {
            $monthAndYear = $payment->getDate()->format("mY");
            if ($monthAndYear === '072019') {
                $count++;
            }
        }
        if ($count > 1 && $toDelete) {
            $output->writeln(
                sprintf(
                    "The policy %s has %u payments scheduled for July. Cancelling %s",
                    $policy->getId(),
                    $count,
                    $toDelete->getId()
                )
            );
            if ($dryRun) {
                $output->writeln(
                    sprintf(
                        "The payment %s on policy %s would be cancelled",
                        $toDelete->getId(),
                        $policy->getId()
                    )
                );
            } else {
                $output->writeln(
                    sprintf(
                        "The payment %s on policy %s has been cancelled",
                        $toDelete->getId(),
                        $policy->getId()
                    )
                );
                $toDelete->cancel('Incorrectly scheduled additional payment.');
            }
        } elseif ($count > 1) {
            $output->writeln(
                sprintf(
                    "Policy %s has %u payments in July, but one is not the 30th. Manual check required.",
                    $policy->getId(),
                    $count
                )
            );
        } else {
            $output->writeln(
                sprintf(
                    "Policy %s schedule appears correct.",
                    $policy->getId()
                )
            );
        }
    }

